import React from 'react'
import styled from "styled-components"
import {Container, Button} from "react-bootstrap"


const FooterContainer = styled(Container)`
    display: flex;
    flex-direction: row;
    height: auto;
    width: auto
    align-items: stretch;
    margin: inherit;
    padding: inherit;
`

const FooterImage = styled.object`
    background-size: cover;
`

export const Footer = () => {
    return (
        <>
        <FooterContainer>
            <FooterImage type="image/svg+xml" data="/assets/images/mountainfooter.svg"></FooterImage>
        </FooterContainer>

        </>
    )
}

export default Footer
